import { Placeholder } from "react-bootstrap";

export const PersonalInfo = [
    {
        section: 1,
        items: [
            {
                label: 'First name',
                type: 'text',
            },
            {
                label: 'Last name',
                type: 'text',
            },
            {
                label: 'Email address',
                type: 'text',
            },
            {
                label: 'Phone number',
                type: 'text'
            }
        ]
    },

    {
        section: 2,
        items: [
            {

                label: 'Expert',
                type: 'select',
                options: ['John Doe', 'Jane Doe', 'Sofia Hayes', 'Jeffrey Ramirez']
            },
            {
                label: 'Service',
                type: 'select',
                options: ['Himalayan Salt Treatment', 'Detox and cellulite treatment', 'Foot care', 'Cleansing Facial', 'Facial Gua Sha', 'Anti-aging facial treatment', 'Keratin Treatment', 'Lashes and brows', 'Laser Hair Removal'],
            },
            {
                label: 'Date and time',
                type: 'text'
            }
        ]
    }
]
